import React from "react";

import { Heading } from './component/Heading';
import { User } from './component/data';
import { Avatar } from './component/Avatar';
import youtuber , {favprog , Profile , Client ,favgame ,Student } from "./component/Name";
import {Add , Mul ,Sub ,Div} from "./component/Cal";

export function App(){
    return(
        <>
            <Heading/>
            <Avatar/>
            <User/>
            <ol>
                <li>My fav is {youtuber}</li>
                <li>Fav program is {favprog}</li>
                <li>Name  is {Profile()}</li>
                <li>My client name is {Client()}</li>
                <li>{favgame}</li>
              
                <li>Sum of the number is {Add( 10 , 23)}</li>
                <li>Sub of the number is {Sub( 10 , 23)}</li>
                <li>Multiply of the number is {Mul( 10 , 23)}</li>
                <li>Division of the number is {Div( 10 , 23)}</li>
            </ol>
            </>
    );
}
